def load_obj_file(fn):
    with open(fn, 'r') as f:
        lines = f.readlines()

    # i = 0
    vv = []
    tri = []
    for line in lines:
        if line[0] == '#':
            continue

        # print(line.strip())

        arr = line.strip().split()
        if len(arr) == 0:
            continue

        if arr[0] == 'v':
            vv.append([float(arr[1]), float(arr[2]), float(arr[3])])

        if arr[0] == 'f':
            tri.append([int(arr[1]), int(arr[2]), int(arr[3])])
        # i += 1
        # if i > 10:
        #     break
    return vv, tri


